window.bookSummaryJSON = "<p>Getting sold to the empire was never part of the plan.</p> <p>Ember lives two very different lives. By day, she's a mysterious Roma future-teller, and by night, she struggles to care for her sick father. All she wants is the power to control her own life - no arranged marriage, no more poverty. Her future-reading talent is what will get her there. But when the Empire discovers her gift, Ember's life changes forever.</p> <p>Ember soon finds her innocent talent is far more dangerous than she believed. The Empire wants to turn her into a deadly weapon. But Ember has plans of her own, and they don't include living under the Empire's control.</p> <p>Because even the best weapons can backfire.</p>"; 
